class Slidebar extends React.Component
{
    render()
    {  
        let fs = require('fs');
        let files = fs.readdirSync('./images');
        console.log(files);
        const file = './images/bali.jpg';
        return(
            <div className='slider' 
            style={{backgroundImage: `url(${file})`}}
            >
            </div>
        );
    }
}


export default Slidebar;
